# [0]: Address of Meat boy
# [1]: Meat boy state ()
Level: .word 1

.eqv MEAT_BODY 0x00d11b1b
.eqv SKY 0x00e3fcfd
.eqv ARM 0x00a31818
.eqv HAND 0x00b61a1a
.eqv BLACK 0x00000000
.eqv WHITE 0x00FFFFFF
.eqv YELLOW 0x00fbf236
.eqv PINK_BODY 0x00fa82d4
.eqv PINK_ARM 0x00e037ab
.eqv PINK_HAND 0x00b8338e

.eqv BASE_ADDRESS 0x10008000
.eqv MAX_ADDRESS  0x10018000
.eqv HEADER_END 0x10009800

.eqv LEVEL_1_SPAWN 0x10015824
.eqv LEVEL_1_FINISH 0x1000bdbc

.eqv LEVEL_2_SPAWN 0x10014008

.eqv LEVEL_3_SPAWN 0x1001560c

# Player info array
# [0]: address of top left unit of player hitbox
# [4]: jump state (0: standing/falling, 16-1: jumping)
# [8]: duration of current state
# [12]: health (0 - 3)
# [16]: player moving (0: stable, 1: moving)
# [20]: player direction (0: left, 1: right)
# [24]: player animation state (0-5: frame 1, 5-10: frame 2)
Player:		.word		LEVEL_1_SPAWN, 0, 0, 3, 0, 1, 0

msg: .asciiz "reached here"
.text 
.globl main
main:
	li $s0, BASE_ADDRESS
	li $s1, MAX_ADDRESS
	li $s4, HEADER_END
	la $s2, Level
	la $s3, Player
	
	li $t0, 0
	sw $t0, 4($s3)
	sw $t0, 8($s3)
	sw $t0, 16($s3)
	sw $t0, 24($s3)
	
	li $t0, 1
	sw $t0, 20($s3)
	sw $t0, ($s2)
	
	li $t0, 3
	sw $t0, 12($s3)
	
	li $t0, LEVEL_1_SPAWN
	sw $t0, 0($s3)
	
	
	
	jal draw_menu_screen
	
init_menu:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, keypress_happened_menu	
	# handle user input for menu screen
	j init_menu

keypress_happened_menu:
	lw $t7, 4($t9)
	beq $t7, 113, end_program		# Exit the game if press escape
	beq $t7, 10, level_state		# Go to level 1 if press enter
	j init_menu
	
level_state:

	sw $zero, 16($s3)
	li $t0, 1
	sw $t0, 20($s3)

	lw $t0, 0($s2)
	beq $t0, 1, go_to_one
	beq $t0, 2, go_to_two
	beq $t0, 3, go_to_three
	beq $t0, 4, draw_end_screen

	go_to_one:
		jal init_level_1

	go_to_two:
		jal init_level_2

	go_to_three:
		jal init_level_3
	
	level_loaded:
		jal header_set
		j tick

tick:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	bne $t8, 1, cont_game
	jal keypress_happened
	cont_game:
		lw $a0, 0($s3)
		jal player_reset
		jal meat_movement
	after_movement:
		lw $a0, 0($s3)
		jal draw_player
	
	li $v0, 32
	li $a0, 40
	syscall
	j tick
	
keypress_happened:
	lw $t7, 4($t9)
	beq $t7, 114, restart
	beq $t7, 113, end_program
	beq $t7, 97, keypress_a		# Left
	beq $t7, 100, keypress_d	# Right
	beq $t7, 119, keypress_w	# Jump
	jr $ra

keypress_a:
	sw $zero, 20($s3)
	li $t0, 1
	sw $t0, 16($s3)
	jr $ra

keypress_d:
	li $t0, 1
	sw $t0, 16($s3)
	sw $t0, 20($s3)
	jr $ra

keypress_w:
	lw $t0, 0($s3)
	addi $t0, $t0, 3588
	
	lw $t1, 0($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 4($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 8($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 12($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 16($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 20($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 24($t0)
	beq $t1, 0x003c4e21, grounded
	
	lw $t1, 28($t0)
	beq $t1, 0x003c4e21, grounded
	
	#### Wall Jump ###
	
	lw $t0, 20($s3)
	beqz $t0, meat_left
	li $t6, 0
	lw $t0, 0($s3)
	
	addi $t0, $t0, 36
	j meat_walljump
	
	meat_left:
	lw $t0, 0($s3)
	li $t6, 1
	j meat_walljump
	
	meat_walljump:
	lw $t1, 0($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	# Layer 2 Check
	lw $t1, 512($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	# Layer 3 Check
	lw $t1, 1024($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	# Layer 4 Check
	lw $t1, 1536($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	# Layer 5 Check
	lw $t1, 2048($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	# Layer 6 Check
	lw $t1, 2560($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	# Layer 7 Check
	lw $t1, 3072($t0)
	beq $t1, 0x003c4e21, do_meat_wall
	
	jr $ra
	
	do_meat_wall:
	li $t0, 16
	sw $t0, 4($s3)
	
